\u0412\u043e\u043f\u0440\u043e\u0441 1.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
"Наши юные птенцы, // Цыпа-цыпа-цыпа-цыпа-цыпа, // Хороши пером и пухом
// И тверды умом и духом // Так же, как отцы"; ни пуха вам, ни пера,
уважаемые знатоки!

\u0412\u043e\u043f\u0440\u043e\u0441 6.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Это мнемоническое правило для запоминания цикла Кребса (правое колесо);
первые буквы этой фразы совпадают с первыми буквами продуктов
метаболизма в правом цикле: цитрат, аконитат, изоцитрат...

\u0412\u043e\u043f\u0440\u043e\u0441 12.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Как можно догадаться из названия романа, герой родился в полночь;
стрелки часов, подобно ладоням, соединились и почтительно
поприветствовали родившегося героя по индийскому обычаю.
